import styled from "styled-components";

export const AsideTag = styled.aside`
  border: 1px solid red;
  height: 100%;
  width:30%;
  display: flex;
  background-color:white;
`;
export const MainImage = styled.figure`
  border: 1px solid red;

`;
export const Content = styled.div`
  border: 1px solid red;

`;
